arguments.schema:
{
  "type": "object",
  "title": "IMember",
  "description": "A member schema with personal information and hobbies",
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier for the member"
    },
    "name": {
      "type": "string",
      "description": "Name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Age of the member (must be at least 20 and less than 100)"
    },
    "hobbies": {
      "type": "array",
      "description": "List of member hobbies",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier for the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        },
        "required": ["id", "name"]
      }
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "Timestamp when the member was deleted, or null if not deleted"
    }
  },
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"]
}

